    bool imaginary_part_should_be_zero_in_hpl4(int index, const complex<double>& x) {
        double xre = x.real();
        if (index == 1 or index ==  4 or index ==  7 or index ==  10 or index ==  13 or index ==  16 or index ==  19 or index ==  22 or index ==  25 or index ==  28 or index ==  31 or index ==  34 or index ==  37 or index ==  40 or index ==  43 or index ==  46 or index ==  49 or index ==  52 or index ==
            55 or index ==  58 or index ==  61 or index ==  64 or index ==  67 or index ==  70 or index ==  73 or index ==  76 or index ==  79) {
            if (xre > 0.0 and xre < 1.0) return true;
        }
        else {
            if (xre > -1.0 and xre < 1.0) return true;
            if (xre < -1.0  and (index == 41 or index ==  44 or index ==  50 or index ==  53 or index ==  68 or index ==  71 or index ==  77 or index ==  80)) return true;
            if (xre > 1.0  and (index == 0 or index ==  3 or index ==  9 or index ==  12 or index ==  27 or index ==  30 or index ==  36 or index ==  39)) return true;
        }
        return false;
    }

    complex<double> HPL(int n1, int n2, int n3, int n4, const complex<double>& x){
    
        
        int region = chaplin::find_region(x);
        
        int index_in_base_3 = n4+1 + 3 * (n3+1)
                            + 9 * (n2+1) + 27 * (n1+1);
        
        if ( region == 0 ) {
            return chaplin::HPL4at0(index_in_base_3);
        }
        else if ( region == 1 ) {
            return chaplin::HPL4at1(index_in_base_3);
        }
        else if ( region == 2 ) {
            return chaplin::HPL4atm1(index_in_base_3);
        }
        else if ( region == 3 ) {
            return chaplin::HPL4ar1(index_in_base_3,x);
        }
        else if ( region == 4 ) {
            return chaplin::HPL4arm1(index_in_base_3,x);
        }
        else if ( region == 5 ) {
            return chaplin::HPL4ar0(index_in_base_3,x);
        }
        else if ( region == 6 ) {
            return chaplin::HPL4else(index_in_base_3,x);
            }
        else {
            cout << "Something wierd is happening with region in HPL4, region = " << region << endl;
            exit(1);
        }
    }

