    complex<double> HPL4at0(int index){
        if (index == 40) {
            cout << "chaplin error: call for HPL4(0,0,0,0.0)"
            << " which is divergent! "
            << endl;
            exit(EXIT_FAILURE);
        }
        else return complex<double>(0.0,0.0);
    }
    
